import React from 'react';
import Nav from 'react-bootstrap/Nav';
import './NavLinks.css';
import ButtonBox from '../UIElements/Button';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';
import SearchBar from './Search';
import { ReactComponent as ProfileIcon } from '../../Assets/Images/profile.svg';
import fb from '../../Assets/Images/fb.svg';
import insta from '../../Assets/Images/insta.svg';
import Twitter from '../../Assets/Images/Twitter.svg';
import youtube from '../../Assets/Images/youtube.svg';



const FooterNavLinks = props => {

  // const[logedIn,setlogedIn]=useState(true);

  const logedIn = true;

  return (

    <React.Fragment>
      <div className='social-icons'>
        <img src={fb} alt='' />
        <img src={insta} alt='' />
        <img src={Twitter} alt='' />
        <img src={youtube} alt='' />

      </div>
      <Nav >

        {logedIn ?
          <div className='footer-links-container'>
            <div>
              <React.Fragment>
                <Nav.Link href="#" >Audio Description</Nav.Link>
                <Nav.Link href="/video-on-demand">Investor Relations</Nav.Link>
                <Nav.Link href="/live">Live Videos</Nav.Link>
                <Nav.Link href="/favorites">Favorites</Nav.Link>
              </React.Fragment>
            </div>
            <div>
              <React.Fragment>
                <Nav.Link href="/dashboard" >Home</Nav.Link>
                <Nav.Link href="/video-on-demand">Video on Demand</Nav.Link>
                <Nav.Link href="/live">Live Videos</Nav.Link>
                <Nav.Link href="/favorites">Favorites</Nav.Link>
              </React.Fragment>
            </div>
            <div>
              <React.Fragment>
                <Nav.Link href="/dashboard" >Home</Nav.Link>
                <Nav.Link href="/video-on-demand">Video on Demand</Nav.Link>
                <Nav.Link href="/live">Live Videos</Nav.Link>
                <Nav.Link href="/favorites">Favorites</Nav.Link>
              </React.Fragment>
            </div>
            <div>
              <React.Fragment>
                <Nav.Link href="/dashboard" >Home</Nav.Link>
                <Nav.Link href="/video-on-demand">Video on Demand</Nav.Link>
                <Nav.Link href="/live">Live Videos</Nav.Link>
                <Nav.Link href="/favorites">Favorites</Nav.Link>
              </React.Fragment>
            </div></div>



          : <div></div>}
      </Nav>


      <Nav>{logedIn ? <div className='searchProfileWrap'><div><SearchBar /></div><div><Link to="/profile"><ProfileIcon /></Link></div></div> :
        <Link to="/login"><ButtonBox className="primary-button" text="Sign In" /></Link>
      }
      </Nav>
    </React.Fragment>
  )
};

export default FooterNavLinks;
